        #     info.append(splitForme[1].strip())
        # print(cleanInfo.strip())
        info[0] = info[0].replace("Forme: ","")
        for i in range(len(info)):
            info[i] = str(info[i]).replace("['","")
            info[i] = str(info[i]).replace("']","")
        if (len(info)<5):
            info.append("")
        cleanInfo = "{},{},{},{},{}".format(info[0].strip(),info[1],info[2],str(info[3]),str(info[4]))
